import React from "react";

const colourOptions = [
	{
		value: "OSBL",
		label: "OSBL",
		description: "Out Side Battery Level",
	},
	{
		value: "ISBL",
		label: "ISBL",
		description: "In Side Battery Level",
	},
	{
		value: "FoodHandler",
		label: "Food Handler",
		description: "Food Handler or Canteen workers",
	},
];

export default colourOptions;
